CREATE TABLE `exhibitors` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `exposition_key` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `social_reason` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `contact` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `job` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `stand_location` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `stand_size` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `phone` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `email` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `work_street` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `work_street_number` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `work_colony` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `work_zip` int(11) DEFAULT NULL,
  `web_page` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `twitter` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `event_id` int(11) NOT NULL,
  `created_at` datetime NOT NULL,
  `updated_at` datetime NOT NULL,
  `logo_file_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `logo_content_type` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `logo_file_size` int(11) DEFAULT NULL,
  `logo_updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `exhibitors_event_id_fk` (`event_id`),
  CONSTRAINT `exhibitors_event_id_fk` FOREIGN KEY (`event_id`) REFERENCES `events` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=981 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
